import React, { useState } from 'react';
import axios from '../api/index';

export default function Register() {
  const [formData, setFormData] = useState({
    firstname: '',
    lastname: '',
    email: '',
    username: '',
    password: '',
    confirmpassword: '',
  });

  const formhandler = (e) => {
    e.preventDefault();
    const { firstname, lastname, email, username, password, confirmpassword } = formData;

    // Validation logic here (if needed)
    if (password !== confirmpassword) {
      alert("Passwords do not match.");
      return;
    }

    // Send form data to API via axios
    axios.post('/register', { firstname, lastname, email, username, password })
      .then(response => {
        // Handle response
        console.log('Registration successful', response);
      })
      .catch(error => {
        // Handle error
        console.log('Error during registration', error);
      });
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  return (
    <>
      <div className="flex justify-center h-screen items-center">
        <div className="bg-slate-50 p-4 rounded-xl w-3/12">
          <h2 className="font-bold text-3xl pt-4 mb-2 text-blue-700 text-center">Sign up</h2>
          <p className="font-semibold text-gray-700 text-center">Please register with valid information</p>
          <div className="mt-10">
            <form onSubmit={formhandler}>
              <div className="flex justify-center">
                <div>
                  <input
                    className="bg-gray-100 w-11/12 ml-4 p-2 rounded-lg shadow-sm focus:bg-border-500 focus:ring-2 focus:ring-indigo-400 outline-none text-gray-800"
                    type="text"
                    name="firstname"
                    value={formData.firstname}
                    onChange={handleChange}
                    placeholder="Firstname"
                  />
                </div>
                <div>
                  <input
                    className="bg-gray-100 w-11/12 p-2 rounded-lg shadow-sm focus:bg-border-500 focus:ring-2 focus:ring-indigo-400 outline-none text-gray-800"
                    type="text"
                    name="lastname"
                    value={formData.lastname}
                    onChange={handleChange}
                    placeholder="Lastname"
                  />
                </div>
              </div>
              <div className="mx-2 p-2 rounded-xl mb-1">
                <input
                  className="bg-gray-100 w-full p-2 rounded-lg shadow-sm focus:bg-border-500 focus:ring-2 focus:ring-indigo-400 outline-none text-gray-800"
                  type="email"
                  name="email"
                  value={formData.email}
                  onChange={handleChange}
                  placeholder="Email"
                />
              </div>
              <div className="mx-2 p-2 rounded-xl mb-1">
                <input
                  className="bg-gray-100 w-full p-2 rounded-lg shadow-sm focus:bg-border-500 focus:ring-2 focus:ring-indigo-400 outline-none"
                  type="text"
                  name="username"
                  value={formData.username}
                  onChange={handleChange}
                  placeholder="Username"
                />
              </div>
              <div className="mx-2 p-2 rounded-xl mb-1">
                <input
                  className="bg-gray-100 w-full p-2 rounded-lg shadow-sm focus:bg-border-500 focus:ring-2 focus:ring-indigo-400 outline-none"
                  type="password"
                  name="password"
                  value={formData.password}
                  onChange={handleChange}
                  placeholder="Password"
                />
              </div>
              <div className="mx-2 p-2 rounded-xl mb-1">
                <input
                  className="bg-gray-100 w-full p-2 rounded-lg shadow-sm focus:bg-border-500 focus:ring-2 focus:ring-indigo-400 outline-none"
                  type="password"
                  name="confirmpassword"
                  value={formData.confirmpassword}
                  onChange={handleChange}
                  placeholder="Confirm Password"
                />
              </div>
              <div className="mx-2">
                <button className="bg-blue-600 text-gray-100 font-bold w-full p-1 rounded-lg">
                  Signup
                </button>
              </div>
            </form>
            <div className="flex mx-2 mt-1">
              <p className="text-gray-800 text-sm font-semibold">Already have an account?</p>
              <a className="text-sm font-semibold mx-1 text-blue-500" href="">
                Login
              </a>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
